// SPDX-License-Identifier: MIT
pragma solidity 0.8.10;
/// @title An NFT game for newcomer to the blockchain world. Can be used complementary to Bootcamps to get used to MetaMask and Dapps.
/// @author Lena Hierzi
/// @notice This contract is not aiming for security as it is designed for a playful entry into Dapps and only to be deployed on testnet.
/// @custom:experimental This is an experimental contract.

import "@openzeppelin/contracts/access/Ownable.sol";

contract Booking is Ownable {
    address[6] patients;

    modifier appIdInrange(uint256 _appId) {
        require(
            _appId >= 0 && _appId <= 5,
            "Maximum number of appointment bookings is reached"
        );
        _;
    }

    /// Booking a medical appointment
    function book(uint256 appId) public appIdInrange(appId) returns (uint256) {
        patients[appId] = msg.sender;

        return appId;
    }

    /// Retrieving the appointment
    function getPatients() public view returns (address[6] memory) {
        return patients;
    }
}
